import React from "react";
import { FormControl, Button, Input, OutlinedInput } from "@mui/material";

const Form = () => {
  return (
    // use "& childElement" syntax in MUI to select child elements
    <FormControl sx={{ "& input, & button": { mt: ".5rem" } }}>
      <Input type="text" variant="outlined" placeholder="Email" />
      <OutlinedInput type="text" variant="standard" placeholder="Password" />
      <Button variant="contained" sx={{ bgcolor: "#42a5f5" }}>
        Login
      </Button>
    </FormControl>
  );
};

export default Form;
